import React from "react";
import "./Sliders.css";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const Sliders = () => {
  const photos = [
    {
      name: "photo1",
      url:
        "data:image/jpeg;base64,",
    },
    {
      name: "photo2",
      url:
        "data:image/jpeg;base64,",
    },
    {
      name: "photo3",
      url:
        "data:image/jpeg;base64,",
    },
    {
      name: "photo4",
      url:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSNidgtvjZrddzHzJvwRQvifNUl0iJx5atUhg&usqp=CAU",
    },
  ];

  const settings = {
    dots: true,
    fade: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    className: "slides",
  };

  return (
    <>
      <div className="a">
        <Slider {...settings}>
          {photos.map((photo) => {
            return (
              <div>
                <img width="100%" height="550px" src={photo.url}></img>
              </div>
            );
          })}
        </Slider>
      </div>
    </>
  );
};

export default Sliders;
